import React from 'react';
import 'bootstrap';
import Link from 'next/link';

class NavBar extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            cantGatos : 0
        }
    }

    render(){
        return(
            <nav className="navbar navbar-expand-lg navbar-light bg-light" id="navBar">
                <a className="navbar-brand" href="#">Gatos: {this.state.cantGatos}</a>

                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item active">
                            <Link href="/">
                                <a className="nav-link" href="#">Gatos registrados</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href="/users">
                                <a className="nav-link" href="#">Usuarios registrados</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href="/meet">
                                <a className="nav-link" href="#">Turnos</a>
                            </Link>
                        </li>
                        <li className="nav-item active">
                            <Link href ="/drugs">
                                <a className="nav-link" href="#">Venta de estupefacientes</a>
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        )
    }
}

export default NavBar
